import styled from "styled-components";

export const BackToTopStyle = styled.div`
  .arrow_right,
  .arrow_left {
    width: 50px;
    height: 1px;
    background-color: #f0f0f0;
  }

  .arrow_right {
    transform: rotate(45deg);
  }
`;
